import React from 'react';
import logo from '../logo.svg';
import "bootstrap/dist/css/bootstrap.min.css";
import parth from "../images/parth.jpg";
import ReactTyped from 'typer';
// import './App.css';

class Tag extends React.Component{
    render(){
        return (
            <div className="tag_bg">
                <div className="text-center" style={{color : "white"}}>
                     <img src={parth} className=" tag_img" />
                     <ReactTyped
  typedRef={typedRef()}
  loop
  typeSpeed={50}
  backSpeed={20}
  strings={["welcome to react-typed", "This is a react component that wraps up the <a hre…", "If you like th"]}
  smartBackspace
  shuffle={false}
  backDelay={1}
  fadeOut={false}
  fadeOutDelay={100}
  loopCount={0}
  showCursor
  cursorChar="|"
/>
                     <h1>Full Stack || Android </h1>
                     <h2>Developer</h2>

                </div>
            </div>
        )
    }
};

export default Tag;
